import { FunctionComponent } from "react";
import { NavLink } from "react-router-dom";

import LogoBanner from "../Components/Atoms/LogoBanner";
import Logo from "../Components/Atoms/Logo";

import Cover from "/home/user/website/src/Assets/Images/home4.jpeg"

const Home: FunctionComponent = () => {
    return (
        <div className="home-cover">
            <img src={ Cover } />
            <div className="home-buttons">
                <p>
                    Smart doorbell
                </p>
                <Logo />
                <NavLink className="m-top" to="/menu">
                    <button className="home-cover-button">Menu</button>
                </NavLink>
                <NavLink to="/over-ons">
                    <button className="home-cover-button">Over ons</button>
                </NavLink>
            </div>
        </div>
    );
}

export default Home;
